import React, { useState, useEffect } from 'react';

const ShowEpisodes = ({ episodes }) => {

    const [showEpisodes, updateShowEpisodes] = useState(null);


    return (
        showEpisodes ? showEpisodes : null
    );
}

export default ShowEpisodes;
